  return (
    <>
      <ul className="quickSns">
        <li><a href="###">인천유나이티드 유튜브</a></li>
        <li><a href="###">인천유나이티드 페이스북</a></li>
        <li><a href="###">인천유나이티드 인스타그램</a></li>
      </ul>
    </>
  );
}
